const Statistics = ({ good, neutral, bad, total, avg, positive }) => {
  return (
    <div>
      <h2>statistics</h2>
      <p>good {good}</p>
      <p>neutral {neutral}</p>
      <p>bad {bad}</p>
      <p>all {total}</p>
      <p>average {avg}</p>
      <p>positive {positive}%</p>
    </div>
  );
};

export default Statistics;
